createloanscheme: Is used to create a loan scheme. The first loan scheme created will be set as the default loan scheme. Arguments: mincolratio*: e.g. 175 for 175% minimum collateralization ratio. Cannot be less than 100. interest rate*: annual interest rate, but chargeable per block (scaled to 30-sec block). e.g. 3.5 for 3.5% interest rate. Must be > 0. id*: non-colliding scheme ID that's unique within opspace, e.g. MIN_175 Return: Transaction hash. Example usage: defi-cli createloanscheme 150 5 LOAN150 # mincolratio 150%, interest rate 5%, id "LOAN150" updateloanscheme: Used to update a loan scheme. Arguments: mincolratio*: e.g. 175 for 175% minimum collateralization ratio. Cannot be less than 100. interest rate*: annual interest rate, but chargeable per block (scaled to 30-sec block). e.g. 3.5 for 3.5% interest rate. Must be > 0. id*: id of loan scheme that will be updated ACTIVATE_AFTER_BLOCK: if set, this will only be activated after the set block. The purpose is to allow to provide sufficient warning. Return: Transaction hash. Example usage: defi-cli createloanscheme 150 5 LOAN150
defi-cli createloanscheme 150 5 LOAN150 3020 # Update only after block 3020 destroyloanscheme: Used to destroy a loan scheme. Arguments: id*: the unique identifier of the loan scheme to destroy. ACTIVATE_AFTER_BLOCK: if set, loan will be destroyed after the set block. The purpose is to allow to provide sufficient warning. Return: Transaction hash. Example usage: defi-cli destroyloanscheme LOAN150
defi-cli destroyloanscheme LOAN150 3020 # Destroy only after block 3020 Note All vaults under this loan scheme will be moved to the default loan scheme after destruction. Default loan scheme cannot be destroyed. setdefaultloanscheme: Used to change the default loan scheme. Arguments: id*: the unique identifier of the new default loan scheme. Return: Transaction hash. Example usage: defi-cli setdefaultloanscheme LOAN150 getloanscheme: Get loan scheme information. Arguments: id*: unique identifier of a loan scheme. Return: { "id": "C150", "mincolratio": 150, "interestrate": 5.00000000, "default": true
} Example usage: defi-cli getloanscheme C150 listloanschemes: Retrieve the list of all loan schemes. This command receives no arguments. Return: [ { "id": "C150", "mincolratio": 150, "interestrate": 5.00000000, "default": true }, { "id": "C175", "mincolratio": 175, "interestrate": 3.00000000, "default": false }, . . .
] If there are no loan schemes an empty list is returned [] Example usage: defi-cli listloanschemes

