createvault: Is used to create an empty vault. Arguments: ownerAddress*: the address owning this vault. This address might be owned by the node executing the command or not, meaning, anyone can create vaults to other users. loanSchemeId: id of the loan scheme this vault is subscribed to. This defines the rules applied to this particular vault; the interest rate and the minimum collateral ratio . If omitted the vault will subscribe to the default loan scheme. Return: vaultId (transaction hash). This can be used to identify the created vault inside the blockchain. Note 2 DFIs are charged when creating a vault: 1 DFI will be burned. 1 DFI will be added as collateral of the vault. This last 1 DFI will be send to the address indicated in closevault RPC command. So the overall cost of creating a vault is 1 DFI. Example usage: defi-cli createvault mwSDMvn1Hoc8DsoB7AkLv7nxdrf5Ja4jsF LOAN150
defi-cli createvault mwSDMvn1Hoc8DsoB7AkLv7nxdrf5Ja4jsF # Choose default loan scheme updatevault: Is used to update a vault's owner, loan scheme or both. Arguments: vaultId*: id of the vault to be updated parameters*: object containing the attributes to be updated ownerAddress: address to which transfer the vault. loanSchemeId: id of the loan scheme this vault will be subscribed to. Return: Transaction hash. Note Requires ownerAddress authentication. Update cannot happen while the vault is in either inLiquidation or frozen state. If the loan scheme is set to be destroyed in the future with activateAfterBlock,the update of the vault to that loan scheme will not be allowed. Example usage: defi-cli updatevault 84b22eee1964768304e624c416f29a91d78a01dc5e8e12db26bdac0670c67bb2 \ { "ownerAddress": mwSDMvn1Hoc8DsoB7AkLv7nxdrf5Ja4jsF, \ "loanSchemeId": "LOAN150" } closevault: Is used to close an empty vault. Only vaults with no active loans can be closed by its owner. Arguments: vaultId*: identifier of the vault to be closed. to*: address to which transfer remaining collaterals (if any). Return: Transaction hash. Example usage: defi-cli closevault mwSDMvn1Hoc8DsoB7AkLv7nxdrf5Ja4jsF LOAN150 getvault: Get vault relevant information. Arguments: vaultId*: identifier of the vault. Return: { "vaultId": "279e8a0dc5aa5c57baae66277d0135231934b7be7d8fcc2572ee703b6269eea5", "loanSchemeId": "C200", "ownerAddress": "tpsc2JrxHBEsRJ1PvXSq7pP12jDzBGydTT", "state": "active", "collateralAmounts": [ "700.00000000@DFI" ], "loanAmounts": [ "0.51774842@TSLA" ], "interestAmounts": [ "0.00774842@TSLA" ], "collateralValue": 2199.30307800, "loanValue": 505.27742871, "interestValue": 7.56178403, "informativeRatio": 435.26644038, "collateralRatio": 435
} Example usage: defi-cli getvault 279e8a0dc5aa5c57baae66277d0135231934b7be7d8fcc2572ee703b6269eea5 listvaults: Get the list of vaults on the network. Arguments: We have two optional parameters that will help with the filtering and pagination of the resulting list. options: this object contains the parameters to filter the results ownerAddress: return only vaults owned by this address. loanSchemeId: return vaults that subscribe to a specific loan scheme. state: retrieve vaults that are currently in a specific state (active, froze, inLiquidation...) verbose: show the full information of the vaults listed. See the example returns to see the difference. (boolean) pagination: this object contains the parameters needed for pagination purposes. start: optional first key to iterate from, in lexicographical order. Typically it's set to last ID from previous request. including_start: if true, then iterate including starting position. False by default. limit: maximum number of orders to return, 100 by default. Return: Verbose parameter not set or set to false: [ { "vaultId": "d5611d2823b09eaa9c3a990ae2b372f6fa8c71cfce272c6f942d25f715732f01", "ownerAddress": "tXu6Q9UKN4rKEHykANSMSAQ6Gowijear2i", "loanSchemeId": "C150", "state": "active" }, { "vaultId": "6a63ec6a5f5fd00d1669e17ed547f54f5c561c10cfb1fadcee427688b5c34702", "ownerAddress": "tkjZa5HmeCVzry2Tq77tFouKjm5vQ3NsY7", "loanSchemeId": "C150", "state": "active" }, . . .
