defi-cli listvaults {} '{"start":"3ef9fd5bd1d0ce94751e6286710051361e8ef8fac43cca9cb22397bf0d17e013", "including_start": true, "limit":100}' listvaulthistory: Get the history of a vault. Arguments: vaultId*: identifier of the vault. options: this object contains the parameters to filter the results. maxBlockHeight: optional height to iterate from (down to genesis block), (default = chaintip). depth: maximum depth, from the genesis block is the default. token: filter by token. txtype: filter by transaction type, supported letter from {CustomTxType} e.g. "CloseVault", "PaybackLoan", "UpdateVault" limit: maximum number of records to return, 100 by default. Return: [ { 'address': 'mqYr2o5sGRkBuUm7CkWiBWkM11naYMscog', 'amounts': ['10.00000000@DFI'], 'blockHash': '29097a94dbeeac54de137eb706831062ef8296a402388fd212276d0b0d1945c3', 'blockHeight': 127, 'blockTime': 1649765301, 'txid': 'e6b9b0aed8a0752547e8880685db559ea0abdb3648303fa15117fe02caa459f2', 'txn': 1, 'type': 'CloseVault' }, { 'address': 'mqkdzzVL36dsf9vABwWoq5iBjptS5vyUDU', 'amounts': ['0.50000000@DFI'], 'blockHash': '7c8a41660884dc28e6e59af39ac662208dabc3f61e76b7a096e9d7953bd32804', 'blockHeight': 126, 'blockTime': 1649765300, 'txid': 'a35ee0798c76c48da748f38b47c9abb945586473816308d06731eb352477084a', 'txn': 1, 'type': 'WithdrawFromVault' }, { 'address': 'mfburnZSAM7Gs1hpDeNaMotJXSGA7edosG', 'amounts': ['0.00000228@DFI'], 'blockHash': 'fa20e13c42d2dc3243efcb96f95e2953e30974b46191da074e271077437f2197', 'blockHeight': 125, 'blockTime': 1649765299, 'txid': '611da4b4204eb758f215a383f5602f048cc607f06e9dcd01aca087c963dc1131', 'txn': 1, 'type': 'PaybackLoan' }, . . .
] Example usage: defi-cli listvaulthistory 84b22eee1964768304e624c416f29a91d78a01dc5e8e12db26bdac0670c67bb2 \ '{"maxBlockHeight":160,"depth":10}' deposittovault: Is used to deposit collateral tokens in a vault. Only the owner of the vault can perform this action. Arguments: vaultId*: identifier of the vault to which deposit the collateral amount. from*: address account containing the amount of collateral. amount*: amount of collateral in amount@symbol format. e.g. 1.3@dTSLA Return: Transaction hash. Example usage: defi-cli deposittovault 84b22eee1964768304e624c416f29a91d78a01dc5e8e12db26bdac0670c67bb2i mwSDMvn1Hoc8DsoB7AkLv7nxdrf5Ja4jsF 1.3@dTSLA takeloan: Is used to take a loan (mint dTokens). All arguments are wrapped in a metadata object, see example usage: vaultId*: identifier of the vault to which deposit the collateral amount. to: address to transfer minted tokens. If not specified a valid address will be taken from the wallet. amounts*: amount of requested tokens in amount@symbol format. e.g. 20@dTSLA Return: Transaction hash. Example usage: defi-cli takeloan '{"vaultId": "84b22eee1964768304e624c416f29a91d78a01dc5e8e12db26bdac0670c67bb2", \ "amounts": "10@TSLA"}' defi-cli takeloan '{"vaultId": "84b22eee1964768304e624c416f29a91d78a01dc5e8e12db26bdac0670c67bb2", \ "to": "mwSDMvn1Hoc8DsoB7AkLv7nxdrf5Ja4jsF", \ "amounts": "10@TSLA"}' Note Remember that to be able to take a loan the vault must comply the 50% rule . paybackloan: Is used to payback loan tokens and interests. It does not require authentication so anyone can payback anyone's loan. All arguments are wrapped in a metadata object, see example usage: vaultId*: identifier of the vault to which deposit the collateral amount. from*: address account containing the amount of collateral. amounts**: amount of collateral in amount@symbol format. e.g. 1.3@dTSLA loans**: object list containing specific payment for each loan token. dToken*: dToken symbol to be paid. loans*: amount in amount@token format that will pay for the above dToken Return: Transaction hash. Example usage: # Using amounts
defi-cli paybackloan '{"vaultId": "84b22eee1964768304e624c416f29a91d78a01dc5e8e12db26bdac0670c67bb2i" \ "from": "mwSDMvn1Hoc8DsoB7AkLv7nxdrf5Ja4jsF" \ "amounts": "1.3@dTSLA"}' # Using loans object list
defi-cli paybackloan '{"vaultId": "84b22eee1964768304e624c416f29a91d78a01dc5e8e12db26bdac0670c67bb2i" \ "from": mwSDMvn1Hoc8DsoB7AkLv7nxdrf5Ja4jsF \ "loans": [{"dToken": "dTSLA", "amounts": "1@DFI"} \ {"dToken": "dDOGE", "amounts": "1@DUSD"}]}' Note ** Either use amounts or loans but not both at the same time. The use of one of this arguments is mandatory. Using the loan object allows a more specific way to pay back different loan tokens. If in the other hand amounts argument is used, the loan will be first paid back with the available DFI. If there is not enough balance, the rest of the loan will remain unpaid. withdrawfromvault: Is used to take a loan (mint dTokens). All arguments are wrapped in a metadata object, see example usage: vaultId*: identifier of the vault from which withdraw the collateral amount. to*: address to transfer collateral tokens. amounts*: amount of withdrawn tokens in amount@symbol format. e.g. 20@dTSLA Return: Transaction hash. Example usage: defi-cli withdrawfromvault '{"vaultId": "84b22eee1964768304e624c416f29a91d78a01dc5e8e12db26bdac0670c67bb2", \ "to": "mwSDMvn1Hoc8DsoB7AkLv7nxdrf5Ja4jsF", \ "amounts": "14@TSLA"}'

