In this tutorial we will use the testnet network in order to prevent any possibility of financial loss. Testnet is a separate network from mainnet for the purpose of testing. To use the testnet, stop the defid process, if any, and re-run it with the -testnet flag. Linux and macOS: ./defid -testnet Windows: defid.exe -testnet To verify that you are on the testnet, run ./defi-cli -testnet getblockchaininfo. You should see an output similar to the following { "chain": "test", "blocks": 919519, "headers": 934011,
